import React from "react";
import {
    EvenAndOdd,
    FilterObject,
    FilterString,
    Palindrome,
    Sum,
} from "/src/components/Topics";
// import FilterObject from "./src/components/Topics";
// import FilterString from "./src/components/Topics";
// import Palindrome from "./src/components/Topics";
// import Sum from "./src/components/Topics";

const TopicBrowser = () => {
    return (
        <div className="topic-browser">
            <EvenAndOdd />,
            <FilterObject />,
            <FilterString />,
            <Palindrome />,
            <Sum />
        </div>
    );
};

export default TopicBrowser;
